    std::array<std::array<float, 784>, 128> linear_weights_0;
    std::array<float, 128> linear_bias_0;

    // linear layer 2: 128 -> 64
    std::array<std::array<float, 128>, 64> linear_weights_2;
    std::array<float, 64> linear_bias_2;

    // linear layer 4: 64 -> 10
    std::array<std::array<float, 64>, 10> linear_weights_4;
    std::array<float, 10> linear_bias_4;

    // relu activation function
    float relu(float x) {
        return std::max(0.0f, x);
    }
    
    // softmax activation function
    std::vector<float> softmax(const std::vector<float>& input) {
        std::vector<float> output(input.size());
        float max_val = *std::max_element(input.begin(), input.end());
        float sum = 0.0f;
        
        for (size_t i = 0; i < input.size(); ++i) {
            output[i] = std::exp(input[i] - max_val);
            sum += output[i];
        }
        
        for (size_t i = 0; i < output.size(); ++i) {
            output[i] /= sum;
        }
        
        return output;
    }

